# CODE 1def code1():    str = input()    nums = list(map(int, (str[str.index('[')+1 : str.index(']')].split(','))))    lar2 = [max(nums[0], nums[1]), min(nums[0], nums[1])]    n = len(nums)    for i in range(2,n):        if nums[i]>lar2[0]:            lar2[1] = lar2[0]            lar2[0] = nums[i]        elif nums[i]>lar2[1] and nums[i]!=lar2[0]:            lar2[1] = nums[i]        else:            if lar2[1] == lar2[1]:                lar2[1] = nums[i]    print(lar2[1])# CODE 2def code2():    def isPrime(n) :        if (n <= 1) :            return False        if (n <= 3) :            return True        if (n % 2 == 0 or n % 3 == 0) :            return False        i = 5        while(i * i <= n) :            if (n % i == 0 or n % (i + 2) == 0) :                return False            i = i + 6        return True            str = input()    num = int(str[str.index('=')+1 : len(str)])    if(isPrime(num)):        print('true')    else:        print('false')def main():    code1()    code2()if __name__=="__main__":    main()